// Sets up the autocomleter, shows the start/end control if need be
function createView() {
	chrome.tabs.query({'active': true, 'currentWindow': true}, function (tabs) {
	    var tabUrl = tabs[0].url;
		var step1 = tabUrl.indexOf('step1') != -1;

		// Conditionally show start/end radio button
		$('#controls').toggle(step1);

		// Auto completer
		$('#search').typeahead({
			source: locations,


			updater: function(item) { 
				// step 1
				if (step1) {
					var v = $('input[type=radio]:checked').val();
					if (v == 'start') populateStart(item);
					if (v == 'end') populateEnd(item);	
				// step 2
				} else  {						
					populateBulkAddresses(item);
				}
				return "";
			}
		});
		
		$('#search').focus();

	});
}

function populateStart(value) {
	chrome.tabs.executeScript(null, { 
			code:"var elem = document.getElementById('fld_start_address'); elem.focus(); elem.value ='" + value + "'; elem.blur();"
		}
	);
}
function populateEnd(value) {
	chrome.tabs.executeScript(null, { 
			code:"var elem = document.getElementById('fld_end_address'); elem.focus(); elem.value ='" + value + "'; elem.blur()"
		}
	);
}

function populateBulkAddresses(value) {
	chrome.tabs.executeScript(null, { 
			code:"var elem = document.getElementById('fld_bulkentry'); elem.value += \"" + value + "\\n\";"
		}
	);
	return false;
}

document.addEventListener('DOMContentLoaded', function () {
	
	createView();
});

